import React, { Component, Fragment } from 'react';
import './Logo.scss';
const logo = require("../../../assets/logo/logo.png");

export const Logo = () => {
    return (
        <Fragment>
        <a className="brand" href="introduction.html">
            <img src={logo} alt="logo" className="img-logo" />
        </a>
    </Fragment>
    )
}
